import React, { Component } from "react";

class FormComponent extends Component {
  constructor(props) {
    super(props);
    // console.log(props);
    // console.log(this.props);
    this.state = {
      username: "",
    };
  }

  render() {
    return (
      <form>
        <div>
          <label>Username</label>
          <input
            type="text"
            value={this.state.username}
            onChange={this.handleUsernameChange}
          />
        </div>
      </form>
    );
  }
}

export default FormComponent;
